import React from 'react';
import { useEffect } from "react";
import { useDispatch, useSelector } from "react-redux";
import { getallsafesitie } from '../../actions/actions';
import "./Cards-Panel.css";

export default function Card({ name, country, street, number, email, telephone, postcode }) {
    const dispatch = useDispatch();
    /* 
        useEffect(() => {
            dispatch(getallsafesitie())
        }, [dispatch]);
    
        const lugaresSeguros = useSelector((state) => state.stateSitie)
        console.log(lugaresSeguros) */

    return (
        <div className="fondocard">

            {<div className="card-style">
                <h3>{name}</h3>
                <h3>{country}</h3>
                <h3>{street}</h3>
                <h3>{email}</h3>
                <h3>{telephone}</h3>
                <h3>{postcode}</h3> }
            </div>
            }


        </div>



    )
}
